import * as React from "react";
import Done from "@mui/icons-material/Done";
import styled from "styled-components";

import { era, genre, takePhoto, artMovement, orient } from "./Tags";
import TagsCheckBox from "./TagsCheckBox";
import HorizontalLine from "../common/HorizontalLine";

const Box = styled.div`
  algin-item: left;
  width: 95%;
`;
function HashTag() {
  return (
    <>
      <Box>
        <TagsCheckBox items={takePhoto} />
        <HorizontalLine />
        <TagsCheckBox items={orient} />
        <HorizontalLine />
        장르별
        <TagsCheckBox items={genre} />
        <HorizontalLine />
        시대별
        <TagsCheckBox items={era} />
        <HorizontalLine />
        미술사조
        <TagsCheckBox items={artMovement} />
      </Box>
    </>
  );
}

export default HashTag;
